import './App.css';
import { Routes, Route} from 'react-router-dom';
import IniciarApp from './componentes/IniciarApp';
import Header from './componentes/Header';




function App() {
  return (
    <div className="App">

    <Routes>
      <Route path="/" element={<Header/>&&<IniciarApp/>}></Route>
    </Routes>
    </div>
  );
}

export default App;
